description:
Sharafat Chod Di Maine | 1976 | Hindi Drama | DVDRip | Phantom

Raju, a good hearted, tough and rough village guy is in love with a village belle Preeeta (an introvert). Raju is very possesive about his love, but Preeta's father marries her to somebody else. Raju is shocked and is jilted over and he chooses the wrong path of life. He vows to take revenge from the entire women folk and have no sympathy towards them.

